import React from "react";

import '../../styles/customer/OrderListItem.css';

const UserListItem = ({ data }) => {

    console.log(data)

    return (
        <div className="order_list_item">
            <div className="order_list_section small_order_list_section">{data.status}</div>
            <div className="order_list_section">{ new Date(data.date).toLocaleDateString("de-DE") +"/"+ new Date(data.date).toLocaleTimeString("de-DE") }</div>
            <div className="order_list_section">{data.boxAddress}</div>
            <div className="order_list_section">{data.deliverer}</div>
        </div>
    );
};

export default UserListItem;
